import React, { useEffect , useState} from 'react'
import { TextField,Input, Button} from '@material-ui/core'
import {Form} from "reactstrap";
import { makeStyles } from '@material-ui/core'
import axios from 'axios'
import 'bootstrap/dist/css/bootstrap.min.css';
import HeaderforAdminPage from "../headers/HeaderforAdminpage";
import useAxios from "axios-hooks";
import HeaderCommon from "../headers/HeaderCommon";

const useStyles = makeStyles(()=>({
    TextField : {
        margin : 15
    },
    Button : {
        margin : 22
    },
    boxBorder :{
        border : "gray 5px solid",
        marginTop:10
    },
}));



const EmployeeAddPage = ()=>{


        // const [{data, loading,error}, executePost] = useAxios(
        //     {
        //         url : 'http://localhost:8080/employee/add',
        //         method : 'POST',
        //         data : {
        //             "firstName": firstName,
        //             "middleName": middleName,
        //             "lastName": lastName,
        //             "birthDate": birthDate,
        //             "position": position,
        //             "email": email,
        //             "phoneNumber": phoneNumber,
        //             "role":role
        //         }
        //     },
        // );


    const classes = useStyles();

    const [isSubmitClicked, setIsSubmitClicked] = useState(false);

    const [firstName, setFirstName] = useState("");
    const [middleName, setMiddleName] = useState("");
    const [lastName, setLastName] = useState("");
    const [birthDate, setBirthDate] = useState("");
    const [email, setEmail] = useState("");
    const [phoneNumber, setPhoneNumber] = useState("");
    const [employmentDate, setEmploymentDate] = useState("");
    const [position, setPosition] = useState("");
    const [role, setRole] = useState("");

    useEffect(()=>{
        if(isSubmitClicked === true){
            axios.post("http://localhost:8080/employee/add",

                {
                    "firstName" : firstName,
                    "middleName" : middleName,
                    "lastName" : lastName,
                    "birthDate" : birthDate,
                    "email" : email,
                    "phoneNumber" : phoneNumber,
                    "position" : position,
                    "role" : role
                }

            )
                .then((response) => {
                    const {data} = response
                    console.log(data);
                    //console.log(response.data)
                    alert("Employee is Registered Successfully with info: "+ data);
                    setIsSubmitClicked(false);
                })
                .catch((error) => {
                    console.log(error);
                    setIsSubmitClicked(false);
                    alert(error);


                })
            setIsSubmitClicked(false);
        }

    },[isSubmitClicked,firstName,middleName,lastName,birthDate,email,phoneNumber,employmentDate,position,role]);

    return(

        <>
            <HeaderCommon/>
        <div className={classes.boxBorder}>

            <Form>
                <TextField
                    type = {"text"}
                    className = {classes.TextField}
                    label = {"First Name"}
                    placeholder = {"First Name"}
                    variant = {"outlined"}
                    value = {firstName}
                    onChange = {(event)=>{
                        setFirstName(event.target.value);
                    }}
                />

                <TextField
                    type = {"text"}
                    className = {classes.TextField}
                    label = {"Middle Name"}
                    placeholder = {"middle Name"}
                    variant = {"outlined"}
                    value = {middleName}
                    onChange = {(event)=>{
                        setMiddleName(event.target.value);
                    }}
                />

                <TextField
                    type = {"text"}
                    className = {classes.TextField}
                    label = {"Last Name"}
                    placeholder = {"Last Name"}
                    variant = {"outlined"}
                    value = {lastName}
                    onChange = {(event)=>{
                        setLastName(event.target.value);
                    }}
                />

                <TextField
                    type = {"date"}
                    className = {classes.TextField}
                    variant = {"outlined"}
                    value = {birthDate}
                    onChange = {(event)=>{
                        setBirthDate(event.target.value);
                    }}
                />

                <TextField
                    type = {"email"}
                    className = {classes.TextField}
                    label = {"Email"}
                    placeholder = {"sth@sth.com"}
                    variant = {"outlined"}
                    value = {email}
                    onChange = {(event)=>{
                        setEmail(event.target.value);
                    }}
                />

                <TextField
                    type = {"tel"}
                    className = {classes.TextField}
                    label = {"Mobile Phone Number"}
                    placeholder = {"0912345678"}
                    variant = {"outlined"}
                    value = {phoneNumber}
                    onChange = {(event)=>{
                        setPhoneNumber(event.target.value);
                    }}
                />

                <TextField
                    type = {"text"}
                    className = {classes.TextField}
                    label = {"Position"}
                    placeholder = {"Security Guard"}
                    variant = {"outlined"}
                    value = {position}
                    onChange = {(event)=>{
                        setPosition(event.target.value);
                    }}
                />
                <TextField
                    type = {"text"}
                    className = {classes.TextField}
                    label = {"Role"}
                    placeholder = {"Member"}
                    variant = {"outlined"}
                    value = {role}
                    onChange = {(event)=>{
                        setRole(event.target.value);
                    }}
                />

                <Button
                    className = {classes.Button}
                    variant = {"contained"}
                    color = {"primary"}
                    onClick = {()=> setIsSubmitClicked(true)}
                >
                    save employee
                </Button>

            </Form>
        </div>
        </>
    )
}

export default EmployeeAddPage
